import React from 'react';
import { View,
         Text,
         Button,
         Dimension,
         StyleSheet,
         Image,
         TouchableOpacity } from 'react-native';

const Login = () => {
  return(
    <View style={style.container}>
      <View style={style.header}>
        <Image source={require('../assets/logo2.png')} style={style.logo}>
            </Image>
      </View>
      <View style={style.footer}>
        <Text style={style.title}>Medication at Your Finger Tips</Text>
        <Text style={style.text}>SignIn With Google</Text>
        <TouchableOpacity onPress={()=>alert('Click')} style={style.buttonContainer}>
          <Button
            title="SignIn"
            color="#000220"
          />
        </TouchableOpacity>
        <Text style={style.text}>SignUp With Google</Text>
          <TouchableOpacity onPress={()=>alert('Click')} style={style.buttonContainer}>
          <Button
            title="SignUp"
            color="#000220"
          />
        </TouchableOpacity>
      </View>
    </View>
    );
};

export default Login;



const style = StyleSheet.create({
  container: {
    flex:1,
    backgroundColor:'#000220'
  },
  header:{
    flex: 2,
    justifyContent: 'center',
    alignItems: 'center',
  },
  title:{
    fontSize: 38,
    fontWeight: 'bold',
  },
  footer:{
    flex:1,
    backgroundColor:'#fff',
    borderTopLeftRadius: 30,
    borderTopRightRadius: 30,
    paddingVertical: 50,
    paddingHorizontal: 40
  },
  logoContainer: {
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center',
  },
  logo:{
    width: 150,
    height: 56,
  },
  buttonContainer:{
    paddingVertical: 5,
    marginTop: 10,
    marginBottom: 10,
    borderRadius: 25,
  },
  buttonText:{
    textAlign: 'center',
    color: 'white',
    fontSize: 18,
    fontWeight: 'bold',
  }
})
